import {FaShoppingCart} from 'react-icons/fa'


const Navbar = () => {
  return (
  <div>
    <div className="flex flex-row justify-between">
        <img src="/src/download.jfif" alt="" />
        <div>
          <FaShoppingCart/>
          
        </div>
    </div>
  </div>);
};

export default Navbar;
